import React from 'react'

function NameList() {
    const person=[
        {
            name:"dipen",
            mo:"9537923795",

        },
        {
            name:"dipen mavani",
            mo:"9537923795",

        }
    ]
    const persomap=person.map( p=>{
        <h1>{p.name}::{p.mo}</h1>
    })
    return (
        <div>
            {persomap}
        </div>
    )
}

export default NameList
